<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style type="text/css">
        .box {
            width: 980px;
            height: 300px;
            box-sizing: border-box;
        }

        .box a {
            display: flex;
        }

        a {
            text-decoration: none;
        }

        .description {
            width: 280px;
            height: 300px;
            background: rgba(47, 50, 46, 1);
        }

        .description__logo{
            width: 105px;
            height: 88px;
            margin: 0 auto;
            margin-top: 30px;
        }

        .description__logo img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .description__title{
            text-align: center;
            color: white;
            font-family: "Minion Pro";
            font-size: 27px;
            margin-top: 17px;
        }

        .description__subtitle{
            text-align: center;
            color: white;
            letter-spacing: 0.2px;
            font-size: 14px;
            font-family: "Proxima Nova Rg";
            margin-top: -5px;
            
        }

        .description__button{
            width: 179px;
            height: 33px;
            margin: 0 auto;
            border: 0.7px solid #FFFFFF;
            text-align: center;
            padding-top: 5px;
            font-family: "Proxima Nova Rg";
            color: white;
            margin-top: 29px;
            font-size: 14px;
            box-sizing: border-box;

        }

        .content {
            width: 700px;
            height: 300px;
            background: red;
        }

        .content__image {
            width: 700px;
            height: 265px;
            background: green;
        }

        .content__image img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .footer {
            width: 700px;
            height: 35px;
            background: rgba(18, 60, 72, 1);
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding-left: 10px;
            padding-right: 10px;
            box-sizing: border-box;
        }

        .footer-image-1{
            width: 64px;
            height: 20px;
        }

        .footer-image-2{
            width: 109px;
            height: 19px;
        }

        .footer-image-1 img,
        .footer-image-2 img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }
